import React from 'react';
import Link from 'react-router-dom'

import '../css/Nav.css'

const Nav = () => {
    return (
        <div>
            <nav className="navegacion">
                <Link to={'/nosotros'}> Nosotros </Link>
                <Link to={'/'}> Productos </Link>
                <Link to={'/contacto'}> Contacto </Link>
            </nav>
        </div>
    );
};

export default Nav;
